import styled from 'styled-components';

export const SidebarWrapper = styled.aside`
    width: 200px;
    padding: 10px;
    background: #f0f0f0;
    height: 100%;
`;

export const ListWrapper = styled.li`
    list-style-type: none;
    padding: 10px;
    border-bottom: 1px solid #ddd;
    cursor: pointer;
    font-family: 'Nanum Gothic', sans-serif;
    font-size: 2.0em;
`;
